    function popup(id, editusername, editpassword, userrole, data){
        $('#editUserModal').modal('hide');
        $('#editAreYouSureModal').modal('show');
        var finalText = '<tr class="areYouSureTable"></tr>';
        $.each(data.collector.customer, function(key, item){
            console.log(item);
            var firstText = '<td class="areYouSureTable d-flex justify-content-center" >'+item.FirstName+' '+item.LastName+'</td>';
            finalText = '<tr class="areYouSureTable">'+firstText+'</tr>'
            $('tbody#editAreYouSureTbody').append(finalText);
        });
    }
    function ajaxedit(id,editusername,editpassword,userrole){
        $.ajax({
            url: 'user/' + id,
            type: "PUT",
            headers: {'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')},
            data: {
                id: id,
                editusername: editusername,
                editpassword: editpassword,
                userrole: userrole,
            },
            dataType: 'json',
            success: function (data) {
                if(data.hasOwnProperty('errors')){
                    $('#editAreYouSureModal').modal('hide');
                    $('#editUserModal').modal('show');
                    console.log(data.errors);
                    if(data.errors.hasOwnProperty('editusername')){
                        $('#editusername').addClass("is-invalid");
                        $('#editusernameerrorlabel').html(data.errors.editusername);
                    }
                    else{
                        $('#editusername').removeClass("is-invalid"); 
                    }
                    if(data.errors.hasOwnProperty('editpassword')){
                        $('#editpassword').addClass("is-invalid");
                        console.log( $('#editpassword').attr('class'));
                        $('#editpassworderrorlabel').html(data.errors.editpassword);
                    }
                    else{
                        $('#editpassword').removeClass("is-invalid");
                    }
                }
                else{
                    window.location.reload(true);
                }
            },
            error: function (data) {
                alert(data.responseText);
                    
            }     
        });

    }

